based on the user's IP address.

Here is an example of how you can write a script that denies access to a website or service based on the user's IP address using Node.js and the `http` module:
```
const http = require('http');

const server = http.createServer((req, res) => {
  const ipAddress = req.headers['x-forwarded-for'] || req.connection.remoteAddress;

  if (ipAddress === '192.168.0.1') {
    res.statusCode = 403;
    res.setHeader('Content-Type', 'application/json');
    res.end('{"message": "Access denied"}');
  } else {
    res.statusCode = 200;
    res.setHeader('Content-Type', 'application/json');
    res.end('{"message": "Access granted"}');
  }
});

server.listen(8080, () => {
  console.log('Server listening on port 8080');
});
```
